IF NOT EXISTS (
    select * from sysobjects where name='TB_M_Employees' and xtype='U'
) CREATE TABLE TB_M_Employees (
    [list_id] NVARCHAR(5),
    [list_first_name] NVARCHAR(26),
    [list_last_name] NVARCHAR(13),
    [list_birth_date] NVARCHAR(19),
    [list_gender] NVARCHAR(6),
    [list_email] NVARCHAR(36),
    [list_phone] NUMERIC(13, 0),
    [list_is_deleted] NVARCHAR(5),
    [list_hiring_location] INT,
    [list_create_date] NVARCHAR(19),
    [list_batchClasses] INT
);
